//Library Imports
import { Route, Switch } from 'react-router';

//All Css Imports
import './App.css';

//Component Imports
import Login from './Component/Pages/Login/AdvLogin/AdvanceLoginPage';
import Register from "./Component/Pages/Register/AdvRegister.js/AdvRegister";
import Home from './Component/Pages/Home/Home';

//Start 
function App() {
  return (
    <>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/register" exact component={Register} />
        <Route path="/login" exact component={Login} />
      </Switch>
    </>
  );
}

//Exports 
export default App;
